import React from 'react'
export const PdfViewr = ({doc}) => {
    const PUBLIC_URL='C:\Users\HP\OneDrive\Desktop\react tutorial\my-react-app\public\admission.pdf'
  return (
    <>
   <h2>Viewer</h2>
   {
     doc && (<iframe
        title={doc.name}
        src={`${process.env.PUBLIC_URL}/doc/admission.pdf`}
        width="100%"
        height="500px"
        />)
   }
    </>
  )
}
